import React, { useState, ChangeEvent } from 'react';

interface CommunityOutreachFormData {
  organizationName: string;
  navigatorName: string;
  intakeDate: string;
  participant: {
    firstName: string;
    middleName: string;
    lastName: string;
    dateOfBirth: string;
    gender: string;
    countryOfOrigin: string;
    preferredLanguage: string;
    phoneNumber: string;
    email: string;
    streetAddress: string;
    city: string;
    zipCode: string;
    state: string;
    county: string;
    mailingAddress: string;
    sameAsResidential: boolean;
    dshsClientId: string;
    alienNumber: string;
  };
  immigrationStatus: string[]; // Updated to an array of strings
  eligibilityDate: string;
  programEligibility: {
    receivingServices: boolean;
    ageOver16: boolean;
    livesInWashington: boolean;
    arrivedAfterJuly2021: boolean;
    approvedImmigrationStatus: boolean;
    eligibleForServices: boolean;
    immigrationStatusCopy: boolean;
    consentFormCompleted: boolean;
    releaseFormCompleted: boolean;
  };
  householdMembers: Array<{
    name: string;
    dateOfBirth: string;
    relationship: string;
    immigrationStatus: string;
    intakeEligibilityNeeds: string;
  }>;
  servicesProvided: Array<{
    service: string;
    date: string;
    nextStep: string;
    notes: string;
  }>;
  servicesNeeded: string[];
}

const CommunityOutreachAndEducation: React.FC = () => {
  const [formData, setFormData] = useState<CommunityOutreachFormData>({
    organizationName: '',
    navigatorName: '',
    intakeDate: '',
    participant: {
      firstName: '',
      middleName: '',
      lastName: '',
      dateOfBirth: '',
      gender: '',
      countryOfOrigin: '',
      preferredLanguage: '',
      phoneNumber: '',
      email: '',
      streetAddress: '',
      city: '',
      zipCode: '',
      state: 'Washington',
      county: '',
      mailingAddress: '',
      sameAsResidential: false,
      dshsClientId: '',
      alienNumber: '',
    },
    immigrationStatus: [], // Initialize as an array
    eligibilityDate: '',
    programEligibility: {
      receivingServices: false,
      ageOver16: false,
      livesInWashington: false,
      arrivedAfterJuly2021: false,
      approvedImmigrationStatus: false,
      eligibleForServices: false,
      immigrationStatusCopy: false,
      consentFormCompleted: false,
      releaseFormCompleted: false,
    },
    householdMembers: [],
    servicesProvided: [],
    servicesNeeded: [],
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value, type, checked } = e.target as HTMLInputElement;

    if (name.startsWith('participant.')) {
      const field = name.split('.')[1];
      setFormData((prev) => ({
        ...prev,
        participant: {
          ...prev.participant,
          [field]: type === 'checkbox' ? checked : value,
        },
      }));
    } else if (name.startsWith('programEligibility.')) {
      const field = name.split('.')[1];
      setFormData((prev) => ({
        ...prev,
        programEligibility: {
          ...prev.programEligibility,
          [field]: checked,
        },
      }));
    } else if (name === 'immigrationStatus') {
      // Handle immigrationStatus as an array
      setFormData((prev) => ({
        ...prev,
        immigrationStatus: checked
          ? [...prev.immigrationStatus, value]
          : prev.immigrationStatus.filter((item) => item !== value),
      }));
    } else if (name === 'servicesNeeded') {
      setFormData((prev) => ({
        ...prev,
        servicesNeeded: checked
          ? [...prev.servicesNeeded, value]
          : prev.servicesNeeded.filter((item) => item !== value),
      }));
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: type === 'checkbox' ? checked : value,
      }));
    }
  };

  const handleHouseholdMemberChange = (index: number, e: ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    const updatedHouseholdMembers = [...formData.householdMembers];
    updatedHouseholdMembers[index] = {
      ...updatedHouseholdMembers[index],
      [name]: value,
    };
    setFormData((prev) => ({
      ...prev,
      householdMembers: updatedHouseholdMembers,
    }));
  };

  const addHouseholdMember = () => {
    setFormData((prev) => ({
      ...prev,
      householdMembers: [
        ...prev.householdMembers,
        {
          name: '',
          dateOfBirth: '',
          relationship: '',
          immigrationStatus: '',
          intakeEligibilityNeeds: '',
        },
      ],
    }));
  };

  const removeHouseholdMember = (index: number) => {
    const updatedHouseholdMembers = formData.householdMembers.filter((_, i) => i !== index);
    setFormData((prev) => ({
      ...prev,
      householdMembers: updatedHouseholdMembers,
    }));
  };

  const handleServiceProvidedChange = (index: number, e: ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    const updatedServicesProvided = [...formData.servicesProvided];
    updatedServicesProvided[index] = {
      ...updatedServicesProvided[index],
      [name]: value,
    };
    setFormData((prev) => ({
      ...prev,
      servicesProvided: updatedServicesProvided,
    }));
  };

  const addServiceProvided = () => {
    setFormData((prev) => ({
      ...prev,
      servicesProvided: [
        ...prev.servicesProvided,
        {
          service: '',
          date: '',
          nextStep: '',
          notes: '',
        },
      ],
    }));
  };

  const removeServiceProvided = (index: number) => {
    const updatedServicesProvided = formData.servicesProvided.filter((_, i) => i !== index);
    setFormData((prev) => ({
      ...prev,
      servicesProvided: updatedServicesProvided,
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Community Outreach and Education Form Data:', formData);
  };

  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-lg rounded-lg">
      <h1 className="text-3xl font-bold text-center mb-6">
        Community Outreach and Education Intake/Registration Form
      </h1>
      <form onSubmit={handleSubmit} className="space-y-6">
        {/* Organization and Navigator Information */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Organization Name
            </label>
            <input
              type="text"
              name="organizationName"
              value={formData.organizationName}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Navigator Name
            </label>
            <input
              type="text"
              name="navigatorName"
              value={formData.navigatorName}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Intake Date
            </label>
            <input
              type="date"
              name="intakeDate"
              value={formData.intakeDate}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
        </div>

        {/* Participant Information */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Participant Information</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
              <label className="block text-sm font-medium text-gray-700">
                First Name
              </label>
              <input
                type="text"
                name="participant.firstName"
                value={formData.participant.firstName}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Middle Name
              </label>
              <input
                type="text"
                name="participant.middleName"
                value={formData.participant.middleName}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Last Name
              </label>
              <input
                type="text"
                name="participant.lastName"
                value={formData.participant.lastName}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Date of Birth
              </label>
              <input
                type="date"
                name="participant.dateOfBirth"
                value={formData.participant.dateOfBirth}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Gender
              </label>
              <input
                type="text"
                name="participant.gender"
                value={formData.participant.gender}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Country of Origin
              </label>
              <input
                type="text"
                name="participant.countryOfOrigin"
                value={formData.participant.countryOfOrigin}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Preferred Language
              </label>
              <input
                type="text"
                name="participant.preferredLanguage"
                value={formData.participant.preferredLanguage}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Phone Number
              </label>
              <input
                type="tel"
                name="participant.phoneNumber"
                value={formData.participant.phoneNumber}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Email
              </label>
              <input
                type="email"
                name="participant.email"
                value={formData.participant.email}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Street Address
              </label>
              <input
                type="text"
                name="participant.streetAddress"
                value={formData.participant.streetAddress}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                City
              </label>
              <input
                type="text"
                name="participant.city"
                value={formData.participant.city}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Zip Code
              </label>
              <input
                type="text"
                name="participant.zipCode"
                value={formData.participant.zipCode}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                State
              </label>
              <input
                type="text"
                name="participant.state"
                value={formData.participant.state}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                County
              </label>
              <input
                type="text"
                name="participant.county"
                value={formData.participant.county}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Mailing Address
              </label>
              <input
                type="text"
                name="participant.mailingAddress"
                value={formData.participant.mailingAddress}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              />
            </div>
            <div>
              <label className="flex items-center">
                <input
                  type="checkbox"
                  name="participant.sameAsResidential"
                  checked={formData.participant.sameAsResidential}
                  onChange={handleChange}
                  className="mr-2"
                />
                Same as residential address
              </label>
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                DSHS Client ID #
              </label>
              <input
                type="text"
                name="participant.dshsClientId"
                value={formData.participant.dshsClientId}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Alien #
              </label>
              <input
                type="text"
                name="participant.alienNumber"
                value={formData.participant.alienNumber}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              />
            </div>
          </div>
        </div>

        {/* Current Immigration Status */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Current Immigration Status</h2>
          <div className="grid grid-cols-1 gap-4">
            {[
              { value: 'Refugee', label: 'Refugee' },
              { value: 'Asylum', label: 'Asylum (Approved and granted)' },
              { value: 'Cuban and Haitian entrants', label: 'Cuban and Haitian entrants' },
              { value: 'Amerasians', label: 'Amerasians' },
              { value: 'Certified victims of human trafficking', label: 'Certified victims of human trafficking' },
              { value: 'Iraqi and Afghan Special Immigrants', label: 'Iraqi and Afghan Special Immigrants' },
              { value: 'Afghan Humanitarian Parolees', label: 'Afghan Humanitarian Parolees' },
              { value: 'Afghans with Special Immigrant Parole (SI/SQ Parole) or Special Immigrant Conditional Permanent Residents (SI CPR)', label: 'Afghans with Special Immigrant Parole (SI/SQ Parole) or Special Immigrant Conditional Permanent Residents (SI CPR)' },
              { value: 'Ukrainian Humanitarian Parolees', label: 'Ukrainian Humanitarian Parolees' },
            ].map((option) => (
              <label key={option.value} className="flex items-center">
                <input
                  type="checkbox"
                  name="immigrationStatus"
                  value={option.value}
                  checked={formData.immigrationStatus.includes(option.value)}
                  onChange={handleChange}
                  className="mr-2"
                />
                <span>
                  <strong>{option.label}</strong>
                  <br />
                  {/* Add eligibility details here if needed */}
                </span>
              </label>
            ))}
          </div>
        </div>

        {/* Program Eligibility Determination */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Program Eligibility Determination</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.receivingServices"
                checked={formData.programEligibility.receivingServices}
                onChange={handleChange}
                className="mr-2"
              />
              Is the participant receiving services from resettlement agencies, such as Reception and Placement, Matching Grant, and/or Preferred Community Programs?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.ageOver16"
                checked={formData.programEligibility.ageOver16}
                onChange={handleChange}
                className="mr-2"
              />
              Is the participant 16 years of age or older?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.livesInWashington"
                checked={formData.programEligibility.livesInWashington}
                onChange={handleChange}
                className="mr-2"
              />
              Does the participant live in Washington?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.arrivedAfterJuly2021"
                checked={formData.programEligibility.arrivedAfterJuly2021}
                onChange={handleChange}
                className="mr-2"
              />
              Did the participant arrive in the United States on or after July 1, 2021?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.approvedImmigrationStatus"
                checked={formData.programEligibility.approvedImmigrationStatus}
                onChange={handleChange}
                className="mr-2"
              />
              Does the participant have an approved immigration status?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.eligibleForServices"
                checked={formData.programEligibility.eligibleForServices}
                onChange={handleChange}
                className="mr-2"
              />
              Is the participant eligible for services under the Community Outreach and Education Program?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.immigrationStatusCopy"
                checked={formData.programEligibility.immigrationStatusCopy}
                onChange={handleChange}
                className="mr-2"
              />
              Is a copy of the immigration status collected and kept in the participant record?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.consentFormCompleted"
                checked={formData.programEligibility.consentFormCompleted}
                onChange={handleChange}
                className="mr-2"
              />
              Completed Consent Form
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programEligibility.releaseFormCompleted"
                checked={formData.programEligibility.releaseFormCompleted}
                onChange={handleChange}
                className="mr-2"
              />
              Completed Release of Information Form
            </label>
          </div>
        </div>

        {/* Household Information */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Household Information</h2>
          {formData.householdMembers.map((member, index) => (
            <div key={index} className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Name (First, Middle, Last)
                </label>
                <input
                  type="text"
                  name="name"
                  value={member.name}
                  onChange={(e) => handleHouseholdMemberChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Date of Birth
                </label>
                <input
                  type="date"
                  name="dateOfBirth"
                  value={member.dateOfBirth}
                  onChange={(e) => handleHouseholdMemberChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Relationship to Head of Household
                </label>
                <input
                  type="text"
                  name="relationship"
                  value={member.relationship}
                  onChange={(e) => handleHouseholdMemberChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Current Immigration Status
                </label>
                <input
                  type="text"
                  name="immigrationStatus"
                  value={member.immigrationStatus}
                  onChange={(e) => handleHouseholdMemberChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Intake, Eligibility, and Needs
                </label>
                <input
                  type="text"
                  name="intakeEligibilityNeeds"
                  value={member.intakeEligibilityNeeds}
                  onChange={(e) => handleHouseholdMemberChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <button
                  type="button"
                  onClick={() => removeHouseholdMember(index)}
                  className="text-red-600 hover:text-red-800"
                >
                  Remove Household Member
                </button>
              </div>
            </div>
          ))}
          <button
            type="button"
            onClick={addHouseholdMember}
            className="text-indigo-600 hover:text-indigo-800"
          >
            + Add Household Member
          </button>
        </div>

        {/* Services Needed */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Services Needed</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Outreach"
                checked={formData.servicesNeeded.includes('Outreach')}
                onChange={handleChange}
                className="mr-2"
              />
              Outreach
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Community & Cultural Orientation and Educational Workshops"
                checked={formData.servicesNeeded.includes(
                  'Community & Cultural Orientation and Educational Workshops'
                )}
                onChange={handleChange}
                className="mr-2"
              />
              Community & Cultural Orientation and Educational Workshops
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Information and Referrals"
                checked={formData.servicesNeeded.includes('Information and Referrals')}
                onChange={handleChange}
                className="mr-2"
              />
              Information and Referrals
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Resource Navigation"
                checked={formData.servicesNeeded.includes('Resource Navigation')}
                onChange={handleChange}
                className="mr-2"
              />
              Resource Navigation
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Support Services"
                checked={formData.servicesNeeded.includes('Support Services')}
                onChange={handleChange}
                className="mr-2"
              />
              Support Services
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Other"
                checked={formData.servicesNeeded.includes('Other')}
                onChange={handleChange}
                className="mr-2"
              />
              Other
            </label>
          </div>
        </div>

        {/* Services Provided */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Services Provided</h2>
          {formData.servicesProvided.map((service, index) => (
            <div key={index} className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Service Provided
                </label>
                <input
                  type="text"
                  name="service"
                  value={service.service}
                  onChange={(e) => handleServiceProvidedChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Date of Service
                </label>
                <input
                  type="date"
                  name="date"
                  value={service.date}
                  onChange={(e) => handleServiceProvidedChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Next Step/Follow Up
                </label>
                <input
                  type="text"
                  name="nextStep"
                  value={service.nextStep}
                  onChange={(e) => handleServiceProvidedChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Additional Notes/Comments
                </label>
                <input
                  type="text"
                  name="notes"
                  value={service.notes}
                  onChange={(e) => handleServiceProvidedChange(index, e)}
                  className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                />
              </div>
              <div>
                <button
                  type="button"
                  onClick={() => removeServiceProvided(index)}
                  className="text-red-600 hover:text-red-800"
                >
                  Remove Service
                </button>
              </div>
            </div>
          ))}
          <button
            type="button"
            onClick={addServiceProvided}
            className="text-indigo-600 hover:text-indigo-800"
          >
            + Add Service Provided
          </button>
        </div>

        {/* Submit Button */}
        <div className="flex justify-end">
          <button
            type="submit"
            className="bg-indigo-600 text-white px-6 py-2 rounded-md hover:bg-indigo-700 transition-colors"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default CommunityOutreachAndEducation;
